import React from 'react';
import { Navlink } from 'react'

const Navigation = () => {
    return (
        <div className="navigation">
            <Navlink exact to="/">
                Home 
            </Navlink>
            <Navlink exact to="/API">
                Nos APIs
            </Navlink>            
        </div>
    );
};

export default Navigation;
